import './App.css';
import Facebook from './components/Facebook';
class App extends React.Component
{
  render()
  {
    return (
      <div className="App">
        <button onClick={this.test.bind()}>Test</button>
        <Facebook />
      </div>
    )
  }
}


export default App;
